#define DEFAULT_WTPSTATE_SWITCH	0

static unsigned long
mib_get_wtpState_switch(void) {
	unsigned long wtpState_switch = DEFAULT_WTPSTATE_SWITCH;	/*default*/
	FILE *fp = NULL;    	
	
	fp = fopen("/var/run/wtpState_switch.txt", "r");
	if(NULL == fp) {
		snmp_log(LOG_DEBUG, "Open wtpState_switch.txt error\n");
		goto FAIL_GET;
	}

	if(fscanf(fp, "%lu", &wtpState_switch) <= 0) {
		snmp_log(LOG_DEBUG, "Fscanf wtpState_switch.txt error\n");
		fclose(fp);
		goto FAIL_GET;
	}

	fclose(fp);

	if(!wtpState_switch) {
		goto FAIL_GET;
	}

	return wtpState_switch;
	
FAIL_GET:
	return DEFAULT_WTPSTATE_SWITCH;	/*default*/
}


